function CadastrarPlataforma() {
  return (
   
   <Interno>
            <div class="text-botoes">
                <div>
                    <h1 id='editarperfil'  class="minhalista">Cadastrar Plataforma</h1>
                </div>
   
            </div>
   
   </Interno>         
  )
}

export default CadastrarPlataforma
